#!/usr/bin/env node

"use strict"





var pages         = require('engram/es5/pages')
var publicFiles   = require('engram/es5/public-files')





{
	var dependencies = { }

	dependencies['javascript-head']   = publicFiles.loadJS([ ])
	dependencies['javascript-bottom'] = publicFiles.loadJS([

		'lib-jquery',
		'lib-mithril',
		'lib-mustache',
		'lib-is',
		'lib-require',

		'bundle'
	])

	dependencies.css = publicFiles.loadCSS([
		'style'
	])


}





module.exports = ( ) => {
	return pages.index(dependencies)
}
